import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import IconIonicons from 'react-native-vector-icons/Ionicons'
import createBottomTabNavigator from '@react-navigation/bottom-tabs'
import Header from './composants/header';
import Accueil from './Ecrans/Accueil';
import Questionnaire from './Ecrans/Questionnaire';
import Profil from './Ecrans/Profil';
const Tab = createBottomTabNavigator();


const TabNavigator = () => (
  <Tab.Navigator screenOptions={({ route }) => ({
    tabBarShowLabel: false,
  })}>
    <Tab.Screen name="Accueil" component={Accueil}
      options={{
        headerShown: false,
        tabBarLabel: 'Accueil',
        tabBarIcon: ({ color, size }) => (
          <IconIonicons name="home" color={'black'} size={28} />
        )
      }}
    />
    <Tab.Screen name="Questionnaire" component={Questionnaire}
      options={{
        headerShown: false,
        tabBarLabel: 'Questionnaire',
        tabBarIcon: ({ color, size }) => (
          <IconFontisto name="film" color={'black'} size={28} />
        )
      }}
    />
    <Tab.Screen name="Profil" component={Profil}
      options={{
        headerShown: false,
        tabBarLabel: 'Profil',
        tabBarIcon: ({ color, size }) => (
          <IconFontAwesome name="star" color={'black'} size={28} />
        )
      }}
    />
  </Tab.Navigator>
)


export default function App() {
  return (
    <NavigationContainer>
    <TabNavigator />
  </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
